@annieelainey Waking up / getting up. It takes hours for the pain to lessen and sometimes I need to go to the bathroom before that happens, so I suck it up.

Using my phone often hurts my hands (phones are too dang big for me!).

Showering. I have to lie down or sit after.

@Chonakasinger @_brown_recluse_ @morandareaux Oh, I guess a link to the thing would be handy:
https://t.co/UGTxWXTbqy

Anyway, I'll end this ramble with: this was a project for you, beautiful disabled BIPOC. Thanks for being your glorious selves. üíñ

@thetuttingtutor Yay for accessible typography guides!

I also am a fan of IBM Plex Sans at the moment, but find it a little hard to read on mobile at usual body text sizes (regular is too light, medium is too contrasty).

Was talking awhile ago about wanting a site that evaluates web fonts...

@_smaragdine @lynncyrin I didn‚Äôt even have to email or call anyone!

[ cue chorus of angels ]

For more nerdery, here‚Äôs how I‚Äôve done an accessibility page for events: https://t.co/mXWI3LrbRf

@lynncyrin Oh my gosh!

Sometimes it takes awhile for you to feel an injury, so getting checked out could be a good idea?

Either way, take care. üíú

